import React from 'react'

export const ProductsFunction = () => {

    const carousel = document.querySelector('.carousel')

    const dragging = (e) => {
        console.log(e.pageX);
    }

    carousel.addEventListener('mousemove', dragging)

}
export default ProductsFunction
